import * as React from "react";

function SvgComp(props) {
  return <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 24 24" {...props}><path d="M12 24a12 12 0 1112-12 12.014 12.014 0 01-12 12z" fill="#464646" /><circle cx={12} cy={12} r={11} fill="#a03228" /></svg>;
}
        export const svgString = '<svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 24 24">  <path d="M12,24A12,12,0,1,1,24,12,12.0137,12.0137,0,0,1,12,24Z" fill="#464646"/>  <circle cx="12" cy="12" r="11" fill="#a03228"/></svg>';
        export const SvgComponent = React.memo(SvgComp);
